Question:Develop a Java program que reciba un string de entrada y nos lo convierta en una cadena de numeros enteros, y nos lo convierta en una lista de numeros enteros. El programa debe mostrar por pantalla los numeros que se encuentran en la lista.

Solution: 

```java
public class Ejercicio_02 {
    public static void main(String[] args) {
        String entrada = "cada es un numero";
        int[] numeros = new int[5];

        //Se crea un array con 5 numeros enteros
        for (int i = 0; i < 5; i++) {
            numeros[i] = Integer.parseInt(entrada);
        }

        //Se muestra el arreglo
        System.out.println("Los numeros son: ");
        for (int i = 0; i < 5; i++) {
            System.out.println(numeros[i]);
        }
    }
}
